x=new G.jU(new R.bJ([new R.aq("MaterialInputComponent","material-input:not(material-input[multiline])","angular_components/lib/material_input/material_input.dart",'<p><code>material-input</code> is a single- or multi-line text field where user can enter\ninput. It can optionally have a label.\nNOTE: Clients must declare materialInputDirectives in their directives list\ninstead of MaterialInputComponent.</p>\n<p><strong>Example usage:</strong></p>\n<pre><code>@Component(\n  selector: \'my-component\',\n  template: \'\'\'\n    &lt;material-input label="Your Name"&gt;&lt;/material-input&gt;\n    &lt;material-input multiline label="Enter multiple lines here"&gt;\n    &lt;/material-input&gt;\n    &lt;material-input [(ngModel)]="text"&gt;&lt;/material-input&gt;\n  \'\'\',\n  directives: [materialInputDirectives]\n)\nclass MyComponent {}\n</code></pre>\n<p><strong>Attributes:</strong></p><ul><li><code>type</code> -- The type of the input. Defaults to "text". Other supported\nvalues are "email", "password", "url", "number", "tel", and "search".\n(Inputs of type "number" also use [materialNumberInputDirectives])</li><li><code>multiple</code> -- Whether the user can enter multiple values, separated by\ncommas. This attribute only applies when type = "email", otherwise it is\nignored.</li></ul>\n<p><strong>Inputs:</strong></p><ul><li><code>error</code> -- The error to be shown on the input. Has a higher precedent than\nall other errors.</li><li><code>errorMsg</code> -- The error msg to be shown on the input if the max characters\nare hit.</li><li><code>multiline: bool</code> -- Whether or not the input supports multiple lines.</li><li><code>label: String</code> -- The label to give the input. This is the default text\nthat shows up if nothing\'s entered into the text box.</li><li><code>floatingLabel: bool</code> -- Whether or not the label "floats". If false, the\nlabel disappears when text is entered into the box. If true, it instead\n"floats" up above the input.</li><li><code>hintText: String</code> -- The hint to be shown on the input. This text will\n not be displayed if there is an error message on the input.</li><li><code>showHintOnlyOnFocus: bool</code> -- Whether or not the hint text will be\n displayed when the input is not focused. Defaults to false.</li><li><code>required: bool</code> -- Whether or not the input is required. If there\'s no\ninput text, a required input will show a validation error when it\'s first\nfocused.</li><li><code>disabled: bool</code> -- Whether or not the input is disabled. Disabled inputs\nare grayed out and have a dashed underline.</li><li><code>maxCount: int</code> -- The maximum length of the input.</li><li>DEPRECATED: <code>checkValid: ValidityCheck</code> -- A custom validation function.\nThis function should take in the input text, and return a string\ncontaining an error message, or <code>null</code> if the input is valid. Note: With\nOnPush the validator will not be run on each digest. It is important for\nthe function to change whenever state of the validation function changes.</li><li><code>rightAlign: bool</code> -- Whether or not the input text should be\nright-aligned. Defaults to false.</li><li><code>characterCounter: CharacterCounter</code> -- A custom character counter\nfunction. Takes in the input text; returns how many characters the text\nshould be considered as.</li><li><code>leadingText: String</code> -- Any text to show at the leading edge of the\ninput -- e.g. a currency symbol or similar.</li><li><code>trailingText: String</code> -- Any text to show at the trailing edge of the\ninput -- e.g. a currency symbol or similar.</li><li><code>leadingGlyph: String</code> -- Any symbol to show at the leading edge of the\ninput -- e.g. a URL link icon or similar.</li><li><code>trailingGlyph: String</code> -- Any symbol to show at the trailing edge of the\ninput -- e.g. a URL link icon or similar.</li><li><code>displayBottomPanel: bool</code> -- Whether to display error, hint text, and\ncharacter counter panel.</li><li><code>rows</code> -- If the input is multiline, how many lines there are.</li><li><code>maxRows</code> -- If the input is multiline, the max number of lines.</li><li><code>showCharacterCount</code> -- Force the character count to be displayed if\nmaxCount is null.</li></ul>\n<p><strong>Outputs:</strong></p><ul><li><code>inputKeyPress: String</code> -- Fired when the input text changes -- i.e., on\nevery keypress.</li><li><code>change: String</code> -- Publishes the input text whenever a conceptual "change\nevent" happens -- i.e., when the input loses focus, or when the user hits\nenter.</li><li><code>focus: FocusEvent</code> -- Fired when the input is focused.</li><li><code>blur: FocusEvent</code> -- Fired when this input loses focus.</li></ul>\n')],[new R.am(C.cU,"MaterialInputDemoComponent","material_input_example/lib/material_input_demo.dart"),new R.am(C.bY,"MaterialAutoSuggestInputDemoComponent","material_input_example/lib/material_auto_suggest_input_demo.dart"),new R.am(C.dl,"MaterialPercentInputDemoComponent","material_input_example/lib/material_percent_input_demo.dart"),new R.am(C.dr,"MaterialInputMixinDemoComponent","material_input_example/lib/material_input_mixins.dart"),new R.am(C.dt,"MaterialInputNumberValueAccessorDemoComponent","material_input_example/lib/material_input_number_value_accessor_demo.dart")],[],[],[],P.c()))
